const apiKey = '83i7O10QCBh6UcA8OfZ2Bn9UJPR4f356';

const peticion = fetch (`https://api.giphy.com/v1/gifs/random?api_key=${apiKey}`);

// peticion.then ( (respuesta) => {
//     respuesta.json().then ( (datos) => {
//         console.log(datos.data.images.original.url);
//     })
// })
peticion
    .then ((respuesta) => respuesta.json())
    .then (({data}) => {
        //Puede ser asi pero mejor desestructuro el objeto para acceder a "url"
        // const url = datos.data.images.original.url;
        const {url} = data.images.original; 
        console.log(url);
    })
    .catch (console.warn);
